import logo from './logo.svg';
import './App.css';
import WelcomeScreen from './screens/WelcomeScreen';
import OnePlayerScreen from './screens/OnePlayerScreen';

function App() {
  return (
    <div>
      <WelcomeScreen></WelcomeScreen>
      <OnePlayerScreen></OnePlayerScreen>
    </div>
  );
}

export default App;
























